

<!DOCTYPE html>
<html>

<head>
    <meta http-equiv="Content-Type" content="text/html;charset=UTF-8">
    <title>MPDF</title>

    <style type="text/css">
        input,
        textarea {
            font-family: lucida console;
            font-size: 9pt;
            border: 1px solid #B0B0B0;
        }

        body {
            font-family: lucida console;
            font-size: 9pt;
            background-color: #F0F0F0;
        }

        .container {
            display: flex;
            justify-content: space-around;
        }

        .editor {
            width: 42%;
        }

        .pdf {
            width: 50%;
        }

        .div-btn {
            display: block;
            width: 100%;
            text-align: center;
        }

        .btn-refresh {
            background-color: red;
            color: white;
        }
    </style>
</head>

<body>
    <div class="div-btn">
        <button class="btn-refresh" id="btn-refresh">REFRESCAR</button>
    </div>
    <br>
    <div class="container">
        <div class="editor">
            <textarea id="mytextarea" name="text" cols="80" rows="15"></textarea>
        </div>
        <div class="pdf">
            <iframe width="600" height="620" id="frame" src="data:application/pdf;base64,">
            </iframe>
        </div>
    </div>

    <script src="https://ajax.googleapis.com/ajax/libs/jquery/2.1.1/jquery.min.js"></script>
    <!-- script del editor  -->
    <script src="js/tinymce.min.js"></script>
    <!-- script del lenguaje en espaol -->
    <script src="lang/es.js"></script>

    <script>
        //var useDarkMode = window.matchMedia('(prefers-color-scheme: dark)').matches;

        tinymce.init({
            selector: '#mytextarea',
            plugins: 'print preview powerpaste casechange importcss tinydrive searchreplace autolink autosave save directionality advcode visualblocks visualchars fullscreen image link media mediaembed template codesample table charmap hr pagebreak nonbreaking anchor toc insertdatetime advlist lists checklist wordcount tinymcespellchecker a11ychecker imagetools textpattern noneditable help formatpainter permanentpen pageembed charmap tinycomments mentions quickbars linkchecker emoticons advtable export',
            language: "es",
            mobile: {
                plugins: 'print preview powerpaste casechange importcss tinydrive searchreplace autolink autosave save directionality advcode visualblocks visualchars fullscreen image link media mediaembed template codesample table charmap hr pagebreak nonbreaking anchor toc insertdatetime advlist lists checklist wordcount tinymcespellchecker a11ychecker textpattern noneditable help formatpainter pageembed charmap mentions quickbars linkchecker emoticons advtable'
            },
            menu: {
                tc: {
                    title: 'Comments',
                    items: 'addcomment showcomments deleteallconversations'
                }
            },
            menubar: 'file edit view insert format tools table tc help',
            toolbar: 'undo redo | bold italic underline strikethrough | fontselect fontsizeselect formatselect | alignleft aligncenter alignright alignjustify | outdent indent |  numlist bullist checklist | forecolor backcolor casechange permanentpen formatpainter removeformat | pagebreak | charmap emoticons | fullscreen  preview save print | insertfile image media pageembed template link anchor codesample | a11ycheck ltr rtl | showcomments addcomment',
            autosave_ask_before_unload: true,
            autosave_interval: '30s',
            autosave_prefix: '{path}{query}-{id}-',
            autosave_restore_when_empty: false,
            autosave_retention: '2m',
            image_advtab: true,
            link_list: [
                /*  Enlaces predefinidos  */
                // { title: 'My page 1', value: 'https://www.tiny.cloud' },
                // { title: 'My page 2', value: 'http://www.moxiecode.com' }
            ],
            image_list: [
                /*  Enlaces de imagenes predefinidos  */
                // { title: 'My page 1', value: 'https://www.tiny.cloud' },
                // { title: 'My page 2', value: 'http://www.moxiecode.com' }
            ],
            image_class_list: [{
                    title: 'None',
                    value: ''
                },
                {
                    title: 'Some class',
                    value: 'class-name'
                }
            ],
            importcss_append: true,
            templates: [{
                    title: 'New Table',
                    description: 'creates a new table',
                    content: '<div class="mceTmpl"><table width="98%%"  border="0" cellspacing="0" cellpadding="0"><tr><th scope="col"> </th><th scope="col"> </th></tr><tr><td> </td><td> </td></tr></table></div>'
                },
                {
                    title: 'Starting my story',
                    description: 'A cure for writers block',
                    content: 'Once upon a time...'
                },
                {
                    title: 'New list with dates',
                    description: 'New List with dates',
                    content: '<div class="mceTmpl"><span class="cdate">cdate</span><br /><span class="mdate">mdate</span><h2>My List</h2><ul><li></li><li></li></ul></div>'
                }
            ],
            template_cdate_format: '[Date Created (CDATE): %m/%d/%Y : %H:%M:%S]',
            template_mdate_format: '[Date Modified (MDATE): %m/%d/%Y : %H:%M:%S]',
            height: 600,
            image_caption: true,
            quickbars_selection_toolbar: 'bold italic | quicklink h2 h3 blockquote quickimage quicktable',
            noneditable_noneditable_class: 'mceNonEditable',
            toolbar_mode: 'sliding',
            spellchecker_ignore_list: ['Ephox', 'Moxiecode'],
            tinycomments_mode: 'embedded',
            content_style: '.mymention{ color: gray; }',
            contextmenu: 'link image imagetools table configurepermanentpen',
            a11y_advanced_options: true,
            skin: 'oxide',
            tinycomments_author: 'Author name',
            // setup: function(ed) {
            //     ed.on('keydown', function(e) {

            //     });
            // }
        });
        $('#btn-refresh').click(function() {
            var html = tinymce.get('mytextarea').getContent();
            $.ajax({
                type: "POST",
                url: "ajax.php",
                data: {
                    "text": html
                },
                success: function(data) {
                    console.log("Exito");
                    //console.log(data);
                    $('#frame').attr('src', 'data:application/pdf;base64,' + data);
                },
                error: function(data) {
                    console.log("error:");
                    console.log(data);
                }
            });
        });
    </script>

</body>

</html>